import React from 'react';

// Styled componets
import { StyledCell } from './styles/StyledCell';

import { TETROMINOS } from '../tetrominos';

const Cell = ({type}) => (

    <StyledCell 
        type={type} 
        color={TETROMINOS[type].color}
    />
) 

export default Cell;
